function RoomItem() {
    return (
        <div>
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSjv37I0j-fA4IFtS6NlVuhC2Uzo0ZGxl_RFg&usqp=CAU" 
                alt="Avatar" 
                style="width:100%"
            />
            <div class="container">
                <h4><b>John Doe</b></h4>
                <p>Architect & Engineer</p>
            </div>
        </div>
    );
}

export default RoomItem;
